export var CaptionSize;
(function (CaptionSize) {
    CaptionSize[CaptionSize["_1"] = 1] = "_1";
    CaptionSize[CaptionSize["_2"] = 2] = "_2";
})(CaptionSize || (CaptionSize = {}));
export var CaptionTag;
(function (CaptionTag) {
    CaptionTag["p"] = "p";
    CaptionTag["span"] = "span";
    CaptionTag["caption"] = "caption";
    CaptionTag["figcaption"] = "figcaption";
})(CaptionTag || (CaptionTag = {}));
